  \"2016-07-23T12:09:54.561675\",\n\t\"name\": \"blightstatus-demolitions\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Blighted structures that have been demolished
  since the inception of BlightStat on October 1, 2010.  BlightStat is a public meeting
  that tracks the City's progress in meeting Mayor Landrieu's stated goal of eliminating
  10,000 blighted New Orleans properties in three years.  Scheduled update: MonthlyrnrnIn
  February 2014, the City made several changes to the dataset involving data cleaning
  and de-duplication. This process entailed adding demolition start and completion
  dates to demolitions, cleaning and verifying the addresses of demolitions, and removing
  duplicate cases based on their GeoPIN. The data set still includes several cases
  with duplicated GeoPINs, where multiple units were demolished on the same parcel.rnrnAcronyms
  used in the dataset:rnFederal Emergency Management Agency (FEMA)rnImminent Danger
  of Collapse (IDC)rnNew Orleans  Redevelopment Authority (NORA)rnStrategic Demolition
  for Economic Recovery (SDER) also known asrnNew Orleans Strategic Demo (NOSD)rnLouisiana
  Land Trust (LLT)rnrnUPDATED: 7/22/2016\",\n\t\"license_title\": \"Other License
